import React, { memo } from 'react';



const Form = () => {
  return (
   
      <React.Suspense fallback = {
      <div className="form-background">
        <div className="form-content">
          <div className="form-wrapper">
            <h1>Поможем в выборе!</h1>
            <form>
              <label htmlFor="name">Имя</label>
              <input type="text" id="name" name="name" placeholder="Введите ваше имя" required />

              <label htmlFor="email">Email:</label>
              <input type="email" id="email" name="email" placeholder="Введите ваш email" required />

              <label htmlFor="tel">Телефон</label>
              <input type="tel" id="tel" name="tel" placeholder="Введите ваш телефон" required />

              <input type="checkbox" name="agree" required /><label htmlFor="agree">Я принимаю условия обработки данных</label>
              <input type="submit" value="Отправить" />
            </form>
          </div>
          <div className="form-info-wrapper">
            <div className="form-info"></div>
          </div>
        </div>
      </div>}><LazyComponent /></React.Suspense>
  );
};

export default memo(Form);
